const asciiArtElement = document.getElementById('ascii-art');
const cursorElement = document.createElement('span');
cursorElement.classList.add('cursor');
asciiArtElement.appendChild(cursorElement);

// Rotation animation
let frameIndex = 0;
const rotationSpeed = 100; 
let lastTime = 0;

function rotate(timestamp) {
    if (timestamp - lastTime >= rotationSpeed) {
        
        asciiArtElement.firstChild.textContent = asciiFrames[frameIndex];
        frameIndex = (frameIndex + 1) % asciiFrames.length; 
        lastTime = timestamp;
    }
    requestAnimationFrame(rotate);
}

window.onload = () => {
    // Add a text node for the ASCII art
    const textNode = document.createTextNode(asciiFrames[frameIndex]);
    asciiArtElement.insertBefore(textNode, cursorElement);
    requestAnimationFrame(rotate);
};